            return IsPrime((ulong)num);
        }

        public static ulong GetPrime(int index)
        {
            //if (index < _primes.Length)
            return _primes[(ulong)index];
        }

        public static List<ulong> GetAllPrimes(ulong max)
        {
            var primes = new List<ulong>(_primes.Keys);
            return primes.Where(p => p <= max).ToList();
        }
    }
}
